create database AirPollution;
use AirPollution;

show tables;

ALTER USER 'root'@'localhost' IDENTIFIED WITH mysql_native_password BY 'password';
FLUSH PRIVILEGES;

create table Countries(
	CountryID int primary key not null auto_increment,
    CountryName varchar(255) not null,
    ISOCode varchar(50) not null,
    WHORegion varchar(255) not null
);

alter table Countries drop column ISOCode;
select * from Countries;

create table Cities(
	CityID int primary key auto_increment not null,
    CountryID int,
    CityName varchar(255) not null,
    Latitude varchar(25),
    Longitude varchar(25),
    Population int,
    PopulationSource varchar(255),
    foreign key(CountryID) references Countries(CountryID)
);

create table AirQualityMeasures(
	MeasuresID int primary key auto_increment not null,
    CityID int,
    YearOfColllection int not null,
    PM10Concentration int,
    PM2_5Concentration int,
    NO2Concentration int,
    PM10Temp_Coverage int,
    PM2_5Temp_Coverage int,
    NO2Temp_Coverage int,
    TypeOfStations varchar(255),
    foreign key(CityID) references Cities(CityID)
);

alter table AirQualityMeasures change YearOfColllection Year int;

